import React from "react";

const ContactList = ({contacts}) => {
    return <div>
        <ul>
            {contacts.map(({ name, number, sex }) => (
                <li>{name}: {number} ({sex})</li>
            ))}
        </ul>
    </div>
}

export default ContactList
